import React from 'react';
import { NavLink } from 'react-router-dom';

function Navbar() {
  const style = {
    paddingRight: '16px',
    textDecoration: 'none',
    color: 'black'
  }

  return (
    <div>
      <NavLink to='/ecommerce/colection/new-arrivals' style={style}>New Arrivals</NavLink>
      <NavLink to='/ecommerce/colection/house-home' style={style}>Home + Bath</NavLink>
      <NavLink to='/ecommerce/colection/kitchen' style={style}>Kitchen + Dinning</NavLink>
      <NavLink to='/ecommerce/colection/office' style={style}>Office + Craft</NavLink>
      <NavLink to='/ecommerce/colection/personal-goods' style={style}>Personal Goods</NavLink>
    </div>
  );
}


export default Navbar;
